import React from 'react'

const Pagination = ({data}) => {
    let pagNumbers = [];
    for(let i = 1; i< Math.ceil(data.length/10)+1; i++){
        pagNumbers.push(i);
    }
  return (
    <div>
        <center>
            {
                pagNumbers.map(page => <div className='pagebutton'>{page}</div>)
            }
        </center>
    </div>
  )
}

export default Pagination
